    id: "p1",
    title: "empire state building",
    description: "One of the tallest building in the world",
    imageUrl:
      "https://www.google.com/maps/uv?pb=!1s0x89c259a9b3117469:0xd134e199a405a163!3m1!7e115!4shttps://lh5.googleusercontent.com/p/AF1QipOFozz7SVyGzuJPJShbxfjohaTXq-KAZ3nM_ZHM%3Dw238-h160-k-no!5sempire+state+building+-+Google+Search!15zQ2dJZ0FRPT0&imagekey=!1e10!2sAF1QipOFozz7SVyGzuJPJShbxfjohaTXq-KAZ3nM_ZHM&hl=en&sa=X&ved=2ahUKEwjvt5_Esbn1AhXfIUQIHQNoCjMQoip6BAg7EAM",
    address: "20 W 34th St, New York, NY 10001",
    creator: "u1",
    location: {
      lat: 12,
      long: 150,
    },
  },
  {
    id: "p2",
    title: "empire state building",
    description: "One of the tallest building in the world",
    imageUrl:
      "https://www.google.com/maps/uv?pb=!1s0x89c259a9b3117469:0xd134e199a405a163!3m1!7e115!4shttps://lh5.googleusercontent.com/p/AF1QipOFozz7SVyGzuJPJShbxfjohaTXq-KAZ3nM_ZHM%3Dw238-h160-k-no!5sempire+state+building+-+Google+Search!15zQ2dJZ0FRPT0&imagekey=!1e10!2sAF1QipOFozz7SVyGzuJPJShbxfjohaTXq-KAZ3nM_ZHM&hl=en&sa=X&ved=2ahUKEwjvt5_Esbn1AhXfIUQIHQNoCjMQoip6BAg7EAM",
    address: "20 W 34th St, New York, NY 10001",
    creator: "u2",
    location: {
      lat: 12,
      long: 150,
    },
  },
];

const UserPlaces: React.FC = () => {
  return <PlaceList items={DUMMY_PLACES} />;
};

export default UserPlaces;
